INSERT INTO `nackenbügel-kopfhörer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (1, '../img/products/Nackenbügel-Kopfhörer/Soundpeats Force Pro.webp;', 'Soundpeats Force Pro', 'https://www.amazon.de/SoundPEATS-Force-Pro/dp/B086DCTF5K/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=9MZNP1ED1LV9&keywords=Soundpeats+Force+Pro&qid=1667231663&qu=eyJxc2MiOiIwLjM0IiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=%2Caps%2C67&sr=8-3', '55,99', 4.3, 764, 0, 'SoundPEATS;Erwachsener;Bluetooth;Im Ohr;Kabellos;♫ [Dual Dynamic Drivers &amp; Crossover] - Bluetooth-Ohrhörer bieten einen nie da gewesenen Premium-Sound mit knackigen Höhen und tiefen Bässen, ideal zum Hören und Konversieren einer Vielzahl von Melodien, Filmen, Podcasts, Anrufen, Videos usw., insbesondere für Musikliebhaber .|♬ [Bluetooth 5.0 &amp; Qualcomm 3034] - Diese kabellosen Ohrhörer mit Nackenbügel verwenden die fortschrittlichste Bluetooth 5.0-Technologie und den Qualcomm 3034-Chipsatz, sorgen für einen geringeren Energieverbrauch, eine stabilere Signalverbindung und eine schnellere Übertragungsgeschwindigkeit zwischen den Ohrhörern und Ihrem Gerät.|♪ [Qualcomm aptX HD &amp; integriertes Mikrofon] - Mit dem Fokus von Qualcomm aptX HD auf High-Definition-Audio bieten diese In-Ear-Kopfhörer mit Nackenbügel kristallklare Anrufe mit geringerem Kommunikationsrauschen. Das eingebaute Mikrofon macht es Ihnen leicht, drahtlos zu telefonieren, ohne Probleme beim Ein- und Ausschalten.|∮ [Magnetische Ohrhörer &amp; Nackenbügel-Design] - Unter dem Einfluss von Magnetkraft können Sie die kabellosen Bluetooth-Ohrhörer leicht entfernen und um den Hals hängen, wenn Sie sie nicht verwenden. Das Silikon-Nackenband ist leicht und weich, sehr praktisch, um die Ohrhörer beim Gehen mitzunehmen.|‿◕ [22 Stunden Dauer und schnelles Aufladen] - Nur 2,5 Stunden Ladezeit, Sie können die drahtlosen Ohrhörer bis zu 22 Stunden verwenden, müssen Sie sich bei Outdoor- oder Indoor-Aktivitäten keine Sorgen um den leeren Akku machen.');
INSERT INTO `nackenbügel-kopfhörer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (2, '../img/products/Nackenbügel-Kopfhörer/Avantree HT4186.webp;', 'Avantree HT4186', 'https://www.amazon.de/Avantree-Funkkopfh%C3%B6rer-Nackenb%C3%BCgel-Transmitter-REICHWEITE/dp/B07GDDL99H/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=1830GQR39F8L9&keywords=Avantree+HT4186&qid=1667231669&qu=eyJxc2MiOiIxLjI4IiwicXNhIjoiMS4xOSIsInFzcCI6IjEuMDAifQ%3D%3D&sprefix=%2Caps%2C67&sr=8-3', '89,99', 4.1, 6617, 1, 'Avantree;Erwachsener;Bluetooth;Im Ohr;Kabellos;[PLUG &amp; PLAY] Sie müssen nicht den komplexen Bluetooth-Pairing-Prozess durchfšhren; Schließen Sie einfach den Sender des HT4186 an eine Stromquelle und den Audioausgang Ihres Fernsehgeräts an, schalten Sie alles ein, sie werden schnell miteinander verbunden und Sie können loslegen. Funktioniert auch hervorragend mit älteren Nicht-Smart-TVs.|[MAGISCHE VERBINDUNG] Kompatibel mit 99% aller TVs auf dem Markt. Unser HT4186 unterstützt Optisch / AUX und RCA Audio Output ohne Kabelsalat.|[FUNKTIONIERT ZUSAMMEN...UND GETRENNT] Ultimativ Vielseitig wie sie sind, können unserer Kopfhörer als Set oder einzeln genutzt werden. Nutzen Sie die Kopfhörer mit ihrem Handy, PC, TV oder anderen Bluetooth-fähigen Geräten. Nutzen Sie den Transmitter um Bluetooth auf Ihren Kopfhörern, Lautsprechern und mehr zu aktivieren!|[KEINE VERZÖGERUNGEN MEHR] Durch die FastStream Technologie wird die Bluetooth Verzögerung reduziert, wodurch Ihnen hochwertiger Sound in perfekter Synchronisation geboten wird. Ideal zum TV oder Filme schauen, denn das HT4186 kann außerdem zwei Paar Kopfhörer gleichzeitig unterstützen.|[HOHE REICHWEITE &amp; AKKULAUFZEIT] Durch die Bluetooth Klasse I Technologie überträgt Audikast Audiosignale bis zu 30m weit. Unsere Kopfhörer bringen Sie dank einer Akkulaufzeit von bis zu 20 Stunden durch mehrere Filme oder Gaming Sessions.');
