INSERT INTO `nackenbügel-kopfhörer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (5, '../img/products/Nackenbügel-Kopfhörer/Shokz OpenMove.webp;', 'Shokz OpenMove', 'https://www.amazon.de/Bluetooth-Knochenschall-Conduction-Wasserdicht-Staubdicht-Slate-Grey/dp/B09BW29FJS/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=5ZKELBRMCH49&keywords=Shokz+OpenMove&qid=1667231704&qu=eyJxc2MiOiIzLjE1IiwicXNhIjoiMi42OCIsInFzcCI6IjIuNjEifQ%3D%3D&sprefix=%2Caps%2C62&sr=8-3', '89,95', 4.4, 3877, 2, 'SHOKZ;Erwachsener;Bluetooth;Open-Ear;Kabellos;【Stöpselfreier Komfort】 Im Gegensatz zu traditionellen kabellosen Kopfhörern, befinden sich die Knochenschall Kopfhörer vor Ihren Ohren, womit diese frei bleiben. Sie brauchen sich keine Sorgen um „glühende“ Ohren zu machen - selbst wenn Sie an den heißesten Tagen joggen. Das Leichtgewicht von 29g lässt Sie sie kaum bemerken.|【Open-Ear Sicherheit】 Egal, ob Sie joggen, Fahrrad fahren, sprinten oder wandern, die OpenMove kabellosen Sportkopfhörer bieten die sicherste Art und Weise, Musik oder Podcasts zu hören - ohne dabei die Umgebungsgeräusche vollständig auszublenden.|【Awards auf der ganzen Welt &amp; solide Einsteigeroption】 1000+ angemeldete Patente, gewonnene maßgebende Awards auf der ganzen Welt (Red Dot Design Award&amp;VGP Summer). Best-in-Class kabellose Knochenschall-Kopfhörer für Einsteiger, die Ihnen eine exzellente Sport-Kopfhörererfahrung zu einem Einsteigerpreis.|【6 Std. Anrufe und Bluetooth V5.1 】 Holen Sie sich die 10-tägige Standby- und die 6-stündige Akkulaufzeit mit dem schnelles 2-stündigen Laden. Genießen Sie Ihre Musik mit einem schnellen Verbindungsaufbau und einer stabilen Verbindung via Bluetooth 5.1.|【Premium Klangqualität &amp; 2-Jahres-Garantie】 Dieses großartig klingende Bluetooth Knochenschall-Headset hilft Ihnen dabei, balancierte Audioaufnahmen zu genießen und Ihren Sport zu treiben. Das Produkt wird mit einer 2-Jahres-Garantie geliefert.');
INSERT INTO `nackenbügel-kopfhörer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (6, '../img/products/Nackenbügel-Kopfhörer/Jabra Evolve 65.webp;', 'Jabra Evolve 65', 'https://www.amazon.de/JABRA-Evolve-Duo-USB-Bluetooth-Schwarz/dp/B00ODRSN0A/ref=sr_1_2?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=12Q5AM0YYYCG5&keywords=Jabra+Evolve+65&qid=1667231714&qu=eyJxc2MiOiIzLjQxIiwicXNhIjoiMy4wMiIsInFzcCI6IjIuODkifQ%3D%3D&sprefix=%2Caps%2C89&sr=8-2', '118,47', 4.4, 4188, 0, 'Jabra;Erwachsener;-;Ohraufliegend;-;Mehr Bewegungsfreiheit: Mit einer Verbindungsreichweite von bis zu 30 Metern bleiben Sie auch fernab Ihres Schreibtischs mit Ihrem PC, Smartphone oder Tablet verbunden|Lange Akkulaufzeiten und Busylight: Lange Akkulaufzeiten von bis zu 12 Stunden minimieren Unterbrechungen, während das integrierte rote LED aufleuchtet, sobald Sie sich in einem Gespräch befinden|Passive Geräuschunterdrückung für mehr Konzentration: Hochfrequente Geräusche wie laute Stimmen werden effektiv gedämpft – Optimal arbeiten, unabhängig von der Umgebung|Die duale Konnektivitäts-Technologie ermöglicht es Ihnen, sich gleichzeitig mit Ihrem PC und einem weiteren Bluetooth Gerät zu verbinden. Betriebstemperatur: -10 °C bis 50 °C.|Lieferumfang: Jabra Evolve 65 Wireless Stereo On-Ear Headset, USB Bluetooth Adapter, USB-Ladekabel, Neoprentasche – Gewicht: 111 g – Farbe: Schwarz|2 Jahre Garantie');
